import React from 'react'

export default function Content(props) {
    return (
        <div className='content-thumbnail'>
            <img className='content-thumbnail-img' src={props.image_url}></img>
            <div className='content-info'>
                <div className='content-info-title'>{props.name}</div>
            </div>
        </div>
    )
}
